const titleStyle ={ 
  border: 'solid black',
  textAlign: 'center'
}

export default class IntroTitle extends React.Component {
    render() {
        return (
            <Jumbotron fluid>
  <Container>
  <h1 style={titleStyle}>Who is BMC</h1>
    <Card>
  <Card.Body>This is some text within a card body.</Card.Body>
</Card>
  </Container>
</Jumbotron>
        )
    }
}
